function formataTelefone(number) {
    // Certifique-se de que o parâmetro é uma string
    number = number.toString().replace(/[^\d]/g, "");

    let ddi = '55';
    let ddd = number.substring(0, 2);

    if (number.length === 13) {
        ddi = number.substring(0, 2);
        ddd = number.substring(2, 4);
        return ddi + ddd + (parseInt(ddd) <= 28 ? number.substring(4, 13) : number.substring(5, 13));

    } else if (number.length === 11) {
        return ddi + ddd + (parseInt(ddd) <= 28 ? number.substring(2, 11) : number.substring(3, 11));

    } else if (number.length === 10) {
        return ddi + ddd + (parseInt(ddd) <= 28 ? '9' : '') + number.substring(2, 11);

    } else if (number.length === 12) {
        if (number.substring(0, 2) === '55') {
            return number;
        } else if (number.substring(0, 1) === '0') {
            return formataTelefone(number.substring(1, 12));
        } else {
            return number;
        }

    } else {
        return number;
    }
}

